    private static AipFace client = BaiduFaceAPI.getClient();
    //人脸注册
    public static JSONObject faceRegister(String image,String userId,String user_info){
        // 传入可选参数调用接口
        HashMap<String, String> options = new HashMap<String, String>();
        options.put("user_info",user_info);
        options.put("quality_control", "NORMAL");
        options.put("liveness_control", "LOW");
        options.put("action_type", "REPLACE");

        String imageType = "BASE64";
        String groupId = "group_id0";

        // 人脸注册
        JSONObject res = JSON.parseObject(client.addUser(image, imageType, groupId, userId, options).toString(2));
        return res;
    }

    //人脸更新
    public static JSONObject faceUpdate(String user_info,String image,String userId){
        // 传入可选参数调用接口
        HashMap<String, String> options = new HashMap<String, String>();
        options.put("user_info", user_info);
        options.put("quality_control", "NORMAL");
        options.put("liveness_control", "LOW");
        options.put("action_type", "REPLACE");

        String imageType = "BASE64";
        String groupId = "group_id0";


        // 人脸更新
        JSONObject res = JSON.parseObject(client.updateUser(image, imageType, groupId, userId, options).toString(2));
        return res;
    }

    //人脸删除
    public static JSONObject faceDelete(String userId,String faceToken) {
        // 传入可选参数调用接口
        HashMap<String, String> options = new HashMap<String, String>();

        String groupId = "group_id0";

        // 人脸删除
        JSONObject res = JSON.parseObject(client.faceDelete(userId, groupId, faceToken, options).toString());
        return res;
    }

    //用户信息查询
    public static JSONObject faceSelect(String userId) {
        // 传入可选参数调用接口
        HashMap<String, String> options = new HashMap<String, String>();

        String groupId = "group_id0";

        // 用户信息查询
        JSONObject res = JSON.parseObject(client.getUser(userId, groupId, options).toString(2));
        return res;
    }
    //人脸检测
    public static JSONObject faceCheck(String image) {

        // 传入可选参数调用接口
        HashMap<String, String> options = new HashMap<String, String>();
        options.put("face_field", "age");
        options.put("max_face_num", "10");
        options.put("face_type", "LIVE");
        options.put("liveness_control", "LOW");

        String imageType = "BASE64";

        // 人脸检测
        JSONObject res = JSON.parseObject(client.detect(image, imageType, options).toString(2));
        return res;
    }

    //人脸搜索
    public static JSONObject faceSearch(String image) {
        // 传入可选参数调用接口
        HashMap<String, String> options = new HashMap<String, String>();


        options.put("max_face_num", "1");
        options.put("match_threshold", "80");
        options.put("quality_control", "NORMAL");
        options.put("liveness_control", "LOW");
        options.put("user_id", null);
        //返回score最高的那个人
        options.put("max_user_num", "1");


        String imageType = "BASE64";
        String groupIdList = "group_id0";

        // 人脸搜索
        JSONObject res = JSON.parseObject(client.search(image, imageType, groupIdList, options).toString(2));
        return res;
    }

    public static JSONObject faceSearch(String image,String userId) {
        // 传入可选参数调用接口
        HashMap<String, String> options = new HashMap<String, String>();

        options.put("max_face_num", "1");
        options.put("match_threshold", "80");
        options.put("quality_control", "NORMAL");
        options.put("liveness_control", "LOW");
        options.put("user_id", userId);
        //返回score最高的那个人
        options.put("max_user_num", "1");


        String imageType = "BASE64";
        String groupIdList = "group_id0";

        // 人脸搜索
        JSONObject res = JSON.parseObject(client.search(image, imageType, groupIdList, options).toString(2));
        return res;
    }

